    "2015-02-04T19:39:13.106983",nt"name": "performance-metrics-transportation-pavement-cave-ins-a4f5b",nt"isopen":
    false,nt"url": null,nt"notes": "As underground drainage systems age, occasionally
    failures in the pipes and joints can cause pavement cave-ins.  The Department of
    Transportation (CDOT) responds to pavement cave-ins reported through 311u2019s Customer
    Service Requests (CSR) system on a case-by-case basis.  This metric tracks the average
    number of days CDOT takes to complete pavement cave-in repairs per week.  The target
    response time for pavement cave-ins is within 3 days.",nt"license_title": "License
